import React, { useEffect, useState } from "react";
import "../App.css";

const Emails = () => {
  const [emails, setEmails] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchEmails();
  }, []);
  
  const fetchEmails = () => {
    setLoading(true);
    fetch("http://localhost:5000/emails", { credentials: "include" })
      .then((res) => res.json())
      .then((data) => {
        console.log("API response:", typeof data, data);
        setEmails(data);
        setLoading(false);
      })
      .catch((err) => {
        console.error("Error fetching emails:", err);
        setLoading(false);
      });
  };

  return (
    <div className="App">
      <div className="controls-row">
        <input
          type="text"
          placeholder="Search emails..."
          className="search-bar"
        />

        <select className="filter-dropdown">
          <optgroup label="ðŸ“… Filter by Date">
            <option value="today">Today</option>
            <option value="this_week">This Week</option>
            <option value="this_month">This Month</option>
          </optgroup>
          <optgroup label="ðŸ·ï¸ Filter by Label">
            <option value="inbox">Inbox</option>
            <option value="starred">Starred</option>
            <option value="important">Important</option>
            <option value="sent">Sent</option>
          </optgroup>
        </select>

        <select className="length-dropdown">
          <option value="short">ðŸ“„ Short</option>
          <option value="medium">ðŸ“ƒ Medium</option>
          <option value="long">ðŸ“œ Full</option>
        </select>

        <button style={style="margin-bottom: 0rem"} className="refresh-btn" onClick={fetchEmails}>
          ðŸ”„ Refresh
        </button>
      </div>
      <h2 className="email-heading">Your Summarized Emails</h2>
      {loading ? (
        <p className="loading-message">Loading emails...</p>
      ) : emails.length === 0 ? (
        <p className="email-empty">No emails found.</p>
      ) : (
        <div className="email-list">
          {emails.map((email, index) => (
            <div key={email.id}>
              <div className="email-card">
                <h3>{email.subject || "No Subject"}</h3>
                <p><strong>From:</strong> {email.from}</p>
                <p>{email.summary}</p>
                <a
                  href={`https://mail.google.com/mail/u/0/#inbox/${email.id}`}
                  target="_blank"
                  rel="noopener noreferrer"
                  style={{
                    display: "inline-block",
                    marginTop: "1rem",
                    color: "#007bff",
                    textDecoration: "none",
                    fontWeight: "bold",
                  }}
                >
                  Open in Gmail â†’
                </a>
              </div>
              {index !== emails.length - 1 && <hr className="email-divider" />}
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default Emails;
